u0012\u001cHeight\n\u001c178-179cm, depending what time you measure me. (We’re taller in the mornings.)\n\u0012\u001cJob\n\u001cI\u0027m a freelance web analytics consultant. I\u0027ve been doing this for over seven years (funnellinsights.com).\n\u0012\u001cRelationship type\n\u001cMonogamy or monogamish fit me well.\n\nI\u0027ve got experience in:\n- Long-term (up to 3 years+) monogamous\n- Long-term (3 years+) open relationship\n- Meaningful but non-exclusive connections with people who live a long way away; swapping visits\n- Steady friends with benefits\n- Mostly just friends unless we\u0027re feeling it\n\nI\u0027ve never been married/engaged or done totally random hookups with someone I’ve barely talked to. I need some sort of connection. \n\nIf I really fall for someone, then I lean heavily in a monogamous direction, especially romantically.\n\n\u0012\u001cMyers-Briggs (yes I\u0027m aware this is probably more akin to astrology than science, but some people find it indicative :))\n\u001cINTJ (but this varies owing to its inherently low reliability). \n\u0012\u001cBig Five\n\u001cAccording to the scientific gold standard of \"random internet test\", I\u0027m high for Openness to new experience and Agreeableness, and moderately high for Extraversion, Neuroticism, and Conscientiousness.\n\nSome of these are very mixed, however – I\u0027m not prone to anxiety, but I do think quite a bit about the consequences of my actions. I take doing what I said seriously, and I’ve owned literally all areas of my work life entirely alone for over 6 years, but I\u0027m more inclined to be a little disorganized. \n\nExtraversion here is also covering the fact I am the classic \"best one to one/very small groups, likes time to recharge\" introvert. But at parties/conferences, I actively approach and talk to new people.\n\n\u0012\u001cInteresting link so even if you don’t like this profile, you get something out of it\n\n\u001cEvery Noise at Once\n\u0012\u001cWhat I\u0027m looking for\n\u001cI\u0027d like to find a long-term partner, and that\u0027s my main goal and my main priority. I want something I can invest in over the long term.\n\nI\u0027m also happy with just about any other kind of connection, including new friends. \n\nAs I live in Hastings, and most potential people live in London, I\u0027d be happy to swap visits (I love showing Hastings to people) or meet halfway. \n\n\u0012\u001cKids\n\u001cGenerally lean towards wanting them. Not a deal breaker.\n\n\u0012\u001cThings I like to do\n\u001cI like:\n- Learning new things. I find so many things interesting it\u0027s hard to delimit it, but recurring themes are \ni) how and why do people do what they do? \nii) how did things and people come to be the way they are?\niii) what will the future look like?\n\nI also like taking an interest in things for the sake of it. Architecture, natural history, art, fossils etc etc. It doesn\u0027t have to be part of some grand narrative or project to understand the world. If I have a superpower, it’s knowing something about a lot of things.\n\nSome books I’ve liked: Superforecasting, Giovanni’s Room, Science Fictions, Permutation City, The Grapes of Wrath, Being Mortal, The Precipice, Flights, The Book of Trespass, Radical Markets, How Music Works, The Gift of Fear, Deep Work, How Pleasure Works, Moral Tribes, Moral Origins, A Short History of Nearly Everything, Why Have There Been No Great Women Artists?, The Routledge Companion to Ethics, Stories of Your Life and Others, The Poetry of Sex, Wild Nights, Shroom, Intuition Pumps \u0026 Other Tools for Thinking, Writings on an Ethical Life, Three Men in a Boat\n\nSome podcasts I like: Astral Codex Ten, More or Less, Making Sense, Rationally Speaking (RIP), The Happiness Lab\n\n(Listing any of these does not imply a particular level of concordance with the conclusions of their authors/hosts.)\n\n- Hiking \u0026 wild camping. Every year I do one 1 week+ walk and I\u0027ll do numerous shorter self-guided walks with maps. I\u0027ve got a knack for finding secret or little-visited places, even in the south-east of England. My longest so far was walking from Kosovo -\u003e Montenegro -\u003e Albania and back; I have a two week traverse of some islands in the Arctic Circle planned for 2024 [edit: done this! It was beautiful. And boggy], and another traverse of a mountain range in Spain. I take a lot of care to tailor what I do to my company, so don’t fear if these sound intense. I can be very happy doing a shorter amble through the countryside.\n\n- Friends and family. This is one of the best things about my life. I’ve developed a higher-than-average number of close friendships that I work actively to maintain, and I’ve developed new close friendships right into my 30s. I have an exceptionally good \u0026 close relationship with my immediate family. My closest friends are all highly agreeable, intelligent and curious people.\n\n- Running. Trying to get my half-marathon time down. It’s useful. You never know when you might need to run 20k to catch a bus.\n\n- Gigs and live music. I see a bunch of local/UK bands as well occasionally seeing something truly international. My taste is super broad but rock, metal, and folk would be my core genres.\n\n- Cooking. I make food from plants; I’ve been mostly vegan for 6+ years. I have like 100+ ingredients, I enjoy trying things that take work to get the ingredients/recipes for (I’ve translated a few). I like novelty.\n\n- Learning French. I got my B1 certificate ages ago, currently in the push to get to B2 and I want to pass the exam by the end of 2025. I’m currently making every francophone I meet speak to me in French. So I’ve got about 35% more misunderstandings happening in my life than usual right now, sacré bleu !\n\n- Learning more about myself. I’m an analyst by trade. I collect data about myself every day, I journal, I try to improve and figure out my personal operating manual.\n\n"},{"ty":"is","ibi":6122,"s":"\u0011"}
